B.U=new A.eQ(B.W,['-- Hello World Example\nprint("Hello, World!")\nprint("Welcome to LuaLike!")\n\n-- Variables and basic operations\nlocal name = "LuaLike"\nlocal version = 5.4\nprint("Running " .. name .. " " .. version)','-- Fibonacci Sequence\nfunction fibonacci(n)\n    if n <= 1 then\n        return n\n    else\n        return fibonacci(n - 1) + fibonacci(n - 2)\n    end\nend\n\n-- Calculate first 10 fibonacci numbers\nprint("Fibonacci sequence:")\nfor i = 0, 9 do\n    print("F(" .. i .. ") = " .. fibonacci(i))\nend','-- Table Operations\n-- Create a table\nlocal fruits = {"apple", "banana", "cherry"}\n\n-- Add elements\nfruits[4] = "date"\nfruits["favorite"] = "mango"\n\n-- Iterate through table\nprint("Fruits list:")\nfor i, fruit in ipairs(fruits) do\n    print(i .. ": " .. fruit)\nend\n\n-- Table as a map\nlocal person = {\n    name = "Alice",\n    age = 30,\n    city = "New York"\n}\n\nprint("\\nPerson info:")\nfor key, value in pairs(person) do\n    print(key .. ": " .. value)\nend','-- Functions and Closures\n-- Function with multiple return values\nfunction divmod(a, b)\n    local quotient = math.floor(a / b)\n    local remainder = a % b\n    return quotient, remainder\nend\n\nlocal q, r = divmod(17, 5)\nprint("17 \xf7 5 = " .. q .. " remainder " .. r)\n\n-- Closure example\nfunction makeCounter(start)\n    local count = start or 0\n    return function()\n        count = count + 1\n        return count\n    end\nend\n\nlocal counter = makeCounter(10)\nprint("Counter: " .. counter()) -- 11\nprint("Counter: " .. counter()) -- 12\nprint("Counter: " .. counter()) -- 13','-- Metatables Example\n-- Create a vector class\nVector = {}\nVector.__index = Vector\n\nfunction Vector.new(x, y)\n    local v = {x = x or 0, y = y or 0}\n    setmetatable(v, Vector)\n    return v\nend\n\nfunction Vector:__add(other)\n    return Vector.new(self.x + other.x, self.y + other.y)\nend\n\nfunction Vector:__tostring()\n    return "(" .. self.x .. ", " .. self.y .. ")"\nend\n\n-- Create and use vectors\nlocal v1 = Vector.new(3, 4)\nlocal v2 = Vector.new(1, 2)\nlocal v3 = v1 + v2\n\nprint("v1 = " .. tostring(v1))\nprint("v2 = " .. tostring(v2))\nprint("v1 + v2 = " .. tostring(v3))','-- String Manipulation\nlocal text = "  Hello, LuaLike World!  "\n\n-- String functions\nprint("Original: \'" .. text .. "\'")\nprint("Length: " .. #text)\nprint("Upper: " .. string.upper(text))\nprint("Lower: " .. string.lower(text))\nprint("Trimmed: \'" .. string.gsub(text, "^%s*(.-)%s*$", "%1") .. "\'")\n\n-- Pattern matching\nlocal sentence = "The quick brown fox jumps over the lazy dog"\nprint("\\nPattern matching:")\nprint("Words starting with \'t\': " .. string.gsub(sentence, "%f[%a][Tt]%w*", "[%0]"))\n\n-- String formatting\nlocal name, age = "Alice", 25\nprint(string.format("\\nHello, %s! You are %d years old.", name, age))','-- Math Operations\nprint("Basic Math:")\nprint("\u03c0 = " .. math.pi)\nprint("e = " .. math.exp(1))\nprint("sqrt(16) = " .. math.sqrt(16))\nprint("sin(\u03c0/2) = " .. math.sin(math.pi/2))\nprint("log(e) = " .. math.log(math.exp(1)))\n\n-- Random numbers\nmath.randomseed(os.time and os.time() or 12345)\nprint("\\nRandom numbers:")\nfor i = 1, 5 do\n    print("Random " .. i .. ": " .. math.random(1, 100))\nend\n\n-- Calculations\nlocal function factorial(n)\n    if n <= 1 then\n        return 1\n    else\n        return n * factorial(n - 1)\n    end\nend\n\nprint("\\nFactorials:")\nfor i = 1, 8 do\n    print(i .. "! = " .. factorial(i))\nend','-- Coroutines Example\n-- Create a simple coroutine\nfunction numberGenerator()\n    for i = 1, 5 do\n        coroutine.yield(i)\n    end\nend\n\nlocal co = coroutine.create(numberGenerator)\n\nprint("Coroutine values:")\nwhile coroutine.status(co) ~= "dead" do\n    local success, value = coroutine.resume(co)\n    if success then\n        print("Yielded: " .. value)\n    end\nend\n\n-- Producer-consumer pattern\nfunction producer()\n    for i = 1, 3 do\n        print("Producing: " .. i)\n        coroutine.yield(i)\n    end\nend\n\nfunction consumer()\n    local co = coroutine.create(producer)\n    while coroutine.status(co) ~= "dead" do\n        local success, value = coroutine.resume(co)\n        if success then\n            print("Consuming: " .. value)\n        end\n    end\nend\n\nprint("\\nProducer-Consumer:")\nconsumer()','-- Object-Oriented Programming\n-- Simple class implementation\nPerson = {}\nPerson.__index = Person\n\nfunction Person.new(name, age)\n    local self = setmetatable({}, Person)\n    self.name = name\n    self.age = age\n    return self\nend\n\nfunction Person:greet()\n    return "Hello, I\'m " .. self.name .. " and I\'m " .. self.age .. " years old."\nend\n\nfunction Person:birthday()\n    self.age = self.age + 1\n    return self.name .. " is now " .. self.age .. " years old!"\nend\n\n-- Create and use objects\nlocal alice = Person.new("Alice", 25)\nlocal bob = Person.new("Bob", 30)\n\nprint(alice:greet())\nprint(bob:greet())\nprint(alice:birthday())\nprint(bob:birthday())','-- Error Handling with pcall\n-- Function that might fail\nfunction riskyOperation(n)\n    if n < 0 then\n        error("Cannot handle negative numbers")\n    end\n    return n * 2\nend\n\n-- Safe execution with pcall\nprint("Testing error handling:")\nlocal success, result = pcall(riskyOperation, 5)\nif success then\n    print("Success: " .. result)\nelse\n    print("Error: " .. result)\nend\n\nsuccess, result = pcall(riskyOperation, -3)\nif success then\n    print("Success: " .. result)\nelse\n    print("Error: " .. result)\nend\n\n-- Custom error handler\nfunction safeDivide(a, b)\n    if b == 0 then\n        error("Division by zero")\n    end\n    return a / b\nend\n\nprint("\\nSafe division:")\nlocal results = {pcall(safeDivide, 10, 2), pcall(safeDivide, 10, 0)}\nfor i, result in ipairs(results) do\n    print("Result " .. i .. ": " .. tostring(result))\nend','-- File I/O Operations\n-- Write to a file\nlocal file = io.open("test.txt", "w")\nif file then\n    file:write("Hello from LuaLike!\\n")\n    file:write("This is a test file.\\n")\n    file:close()\n    print("File written successfully")\nelse\n    print("Could not open file for writing")\nend\n\n-- Read from a file\nfile = io.open("test.txt", "r")\nif file then\n    print("\\nFile contents:")\n    for line in file:lines() do\n        print(line)\n    end\n    file:close()\nelse\n    print("Could not open file for reading")\nend\n\n-- Working with strings as files\nlocal data = "line1\\nline2\\nline3"\nlocal stringFile = io.open("data", "w")\nstringFile:write(data)\nstringFile:close()\n\nstringFile = io.open("data", "r")\nprint("\\nString file contents:")\nfor line in stringFile:lines() do\n    print("Read: " .. line)\nend\nstringFile:close()'],t.p1)
